Sins of Sister Summers


Jul 6, 2012 - Performers: Danny Wylde, James Deen and Angell Summers


Angell Summers is a very naughty nun. She writes in a journal about her temptations of lust for Father Deen and Father Wylde. She masturbates with a cross at the thought of their power over her. In a surprise room inspection, they find her writings and subject her to cruel corporal punishment and sexual domination. She is overwhelmed with shame but also great pleasure as they bind her and penetrate all of her holes!


